    \\155\SOH\n\
    \\EOT\EOT\EM\STX\a\DC2\EOT\240\EOT\EOT\ETB\SUB\140\SOH\n\
    \An optional public key of the hop. If the public key is given, the payment\n\
    \can be executed without relying on a copy of the channel graph.\n\
